    "import pandas as pd\n",
    "import matplotlib.pyplot as plt\n",
    "\n",
    "# Load the data\n",
    "data_path = \"R:/Personal/Kaustuv Ray/Clean Air/Malden/data analysis/malden_cpcmet.DAT\"\n",
    "df = pd.read_csv(data_path, delimiter=',', header=None, usecols=[0, 2, 7, 8], names=['DateTime', 'Concentration', 'WindSpeed', 'WindDirection'])\n",
    "\n",
    "# Define wind direction sectors\n",
    "sector_s_sw = (df['WindDirection'] >= 180) & (df['WindDirection'] <= 225)  # S-SW sector (180-225 degrees)\n",
    "sector_s_se = (df['WindDirection'] >= 135) & (df['WindDirection'] <= 180)  # S-SE sector (135-180 degrees)\n",
    "\n",
    "# Filter data for S-SW sector and valid wind speed\n",
    "df_s_sw = df[sector_s_sw & (df['WindSpeed'] > 0) & (df['WindSpeed'] <= 12)]\n",
    "\n",
    "# Filter data for S-SE sector and valid wind speed\n",
    "df_s_se = df[sector_s_se & (df['WindSpeed'] > 0) & (df['WindSpeed'] <= 12)]\n",
    "\n",
    "# Plot histograms for concentration distributions within each sector\n",
    "plt.figure(figsize=(16, 6))\n",
    "\n",
    "# Histogram for S-SW sector\n",
    "plt.subplot(1, 2, 1)\n",
    "plt.hist(df_s_sw['Concentration'], bins=20, color='skyblue', alpha=0.7)\n",
    "plt.title('Concentration Distribution in S-SW Sector')\n",
    "plt.xlabel('Concentration (particles/cm3)')\n",
    "plt.ylabel('Frequency')\n",
    "plt.xlim(0, 150000)  # Set x-axis limits\n",
    "plt.ylim(0, 9000)  # Set y-axis limits\n",
    "\n",
    "\n",
    "# Histogram for S-SE sector\n",
    "plt.subplot(1, 2, 2)\n",
    "plt.hist(df_s_se['Concentration'], bins=20, color='salmon', alpha=0.7)\n",
    "plt.title('Concentration Distribution in S-SE Sector')\n",
    "plt.xlabel('Concentration (particles/cm3)')\n",
    "plt.ylabel('Frequency')\n",
    "plt.xlim(0, 150000)  # Set x-axis limits\n",
    "plt.ylim(0, 9000)  # Set y-axis limits\n",
    "\n",
    "\n",
    "plt.tight_layout()\n",
    "plt.show()\n"
